import React from 'react';
import PixelGrid from './components/pixelGrid';

const App = () => {
  return (
    <div>
      <img src={`${process.env.PUBLIC_URL}/logo.png`} alt="Logo" />
      <PixelGrid />
    </div>
  );
};

export default App;
